import React from "react";
import {BrowserRouter,Routes,Route} from 'react-router-dom'

import AppComponent from './AppComponent'
import AddStudent from './AddStudent'
import EditComp from "./EditComp";
//import UseRefComp from "./UseRefComp";

function App() {
  return (
    <>
    <h1>This is react FrontEnd Project</h1>

    <BrowserRouter>
    <Routes>
      <Route path="/" element={<AppComponent></AppComponent>}></Route>
      <Route path="/add" element={<AddStudent></AddStudent>}></Route>
      <Route path="/update/:id" element={<EditComp></EditComp>}></Route>
    </Routes>
    </BrowserRouter>
   /* <UseRefComp></UseRefComp>*/
    </>
  );
}

export default App;
